import React from 'react';

import './Home.css'

export default function Home(props) {
    return (
        <div className='home' id={props.id}>
            <div id='moon' />
            <div id='line-right' />
            <h2 className='name' >R y a n S l e v i n</h2>
            <p className='job-title'>Software Engineer - Vancouver, BC</p>
        </div>
    )
}
